@Thiago Luiz Quem está falando bobagem? Leia com atenção antes de tentar lacrar. ENCONTRARAM SIM ESTERILIDADE MASCULINA EM CHINESES QUE FORAM ATINGIDOS PELO VÍRUS. Falei algo a mais que isso?
Você fala como os chineses que passaram 4 meses falando que não tinha passado tempo e não tinha provas até a epidemia deles virar pandemia mundial.
Você realmente é "muito esclarecido".

